import React, { useState } from 'react'
import { Button, Col, Form, Row } from 'reactstrap'
import './styles.scss';
import '../user/style.scss'
import { useHistory } from 'react-router';

const AddUserForm = ({props}) => {
    const history = useHistory();
    const [formData, setformData] = useState({
        name:'',
        contactNo: '',
        dob:'',
        email: {
            value: '',
            message: ''
        },
        role: ''
    })

    const onValuChange = (label,value) => {
        if (label === "email") {
            let emailRegex = /^([a-zA-Z0-9_\-\.]+)@([a-zA-Z0-9_\-\.]+)\.([a-zA-Z]{2,5})*$/
            console.log(emailRegex.test(value))
        }
        setformData({
            ...formData,
            [label]: value
        });
    }

    return (
        <div className="adduser-form">
            <Row>
                <Col>
                    <p className="page-head text-center">Add User</p>
                </Col>
            </Row>
            <Form className="form-padding">
                <Row className="d-flex space-between mt-3">
                    <Col><label>Name : </label></Col>
                    <Col><input type='text' value={formData.name} maxLength="30" className="custom-form-control custom-form-control__input" onChange={(e) => {
                        onValuChange("name", e.target.value);
                    }}  /></Col>
                </Row>
                <Row className="d-flex space-between mt-3">
                    <Col><label>Email<span className="text-danger">*</span> : </label></Col>
                    <Col><input type='email' required value={formData.email.value} className="custom-form-control custom-form-control__input" onChange={(e) => {
                        onValuChange("email", e.target.value);
                    }} /></Col>
                </Row>
                <Row className="d-flex space-between mt-3">
                    <Col><label>Contact No : </label></Col>
                    <Col><input type='text' value={formData.contactNo} className="custom-form-control custom-form-control__input" onChange={(e) => {
                        onValuChange("contactNo", e.target.value);
                    }} /></Col>
                </Row>
                <Row className="d-flex space-between mt-3">    
                    <Col><label>Datet of Birth : </label></Col>
                    <Col><input type='date' value={formData.dob} className="custom-form-control custom-form-control__input" onChange={(e) => {
                        onValuChange("dob", e.target.value);
                    }}  /></Col>
                </Row>
                <Row className="d-flex space-between mt-3">
                    <Col><label>Role <span className="text-danger">*</span> : </label></Col>
                    <Col>
                        <select id="role" className="custom-form-control" onChange={(e) => {
                            onValuChange("role",e.target.value);
                        }}>
                            <option value="" defaultChecked>Select</option>
                            <option value="Owner">Owner</option>
                            <option value="Admin">Admin</option>
                            <option value="Operator">Operator</option>
                            <option value="User">User</option>
                        </select>
                    </Col>
                </Row>
                <Row className="d-flex mt-3 flex-end">
                    <div className="pd-4">
                        <Button className="btn btn__button-secondary" onClick={ () => {
                            history.push('/users')
                        }}>Cancel</Button>
                    </div>
                    <div className="pd-4">
                        <Button type='submit' className="btn btn__button-primary" onClick={() => {

                        }} >Submit</Button>
                    </div>
                </Row>
            </Form>
        </div>
    )
}

export default AddUserForm
